import React from 'react';
import '../styles/add-poll.css';

class AddPoll extends React.Component {

	render() {
		return <section id="addPollView">
			<input className="poll-name-input" value="Опрос #" placeholder="Название опроса" />
            <input className="poll-date-input" value="2024-01-01" placeholder="Дата окончания" />
            <div class="addPoll-buttons">
                <button id="addQuestionBtn">Добавить вопрос</button>
                <button id="postPollBtn">Опубликовать</button>
            </div>
		</section>
	}
}
export { AddPoll };
